import ExploreIcon from '@mui/icons-material/GpsFixed';
import HomeIcon from '@mui/icons-material/Home';
import HistoryIcon from '@mui/icons-material/HourglassBottom';
import LibraryIcon from '@mui/icons-material/MenuBook';
import SubscriptionIcon from '@mui/icons-material/Star';

import React from 'react';
import styled from 'styled-components';
import LogoImage from "../img/logo.png";

const Container = styled.div`
  flex: 1;
  background-color: #202020;
  height: 100vh;
  color: white;
  font-size: 14px;
`;

const Wrapper = styled.div`
  padding: 18px 26px;
`;

const Logo = styled.div`
  display: flex;
  align-items: center;
  gap: 5px;
  font-weight: bold;
  margin-bottom: 25px;
`;

const Img = styled.img`
  height: 25px;
`;

const Item = styled.div`
  display: flex;
  align-items: center;
  gap: 20px;
  cursor: pointer;
`
const Menu = () => {
  return (
    <Container>
      <Wrapper>
        <Logo>
          <Img src={LogoImage} alt="Logo" />
          Infiniview
        </Logo>
          <Item>
            <HomeIcon/>
            Home
          </Item>
          <Item><ExploreIcon/>Explore</Item>
          <Item><SubscriptionIcon />Subscriptions</Item>
          <Item><LibraryIcon />Library</Item>
          <Item> <HistoryIcon />History</Item>
          <Item></Item>
          <Item></Item>
          <Item></Item>
          <Item></Item>
          <Item></Item>
      </Wrapper>
    </Container>
  );
}

export default Menu;
